# Code below compares english and dutch matrices and the test matrix. Then decides what language the test matrix belongs to.
for line in sys.stdin:
    occ_m = eval(line)

    occ_m = pd.DataFrame.from_dict(occ_m)
    nl = pd.DataFrame.from_dict(nl)
    en = pd.DataFrame.from_dict(en)

    nl_diff = abs(nl - occ_m).values.sum()
    en_diff = abs(en - occ_m).values.sum()

    if nl_diff > en_diff:
        print('%s\t%s' % ('en', 1))
    else:
        print('%s\t%s' % ('nl', 1))